ISLAMABAD, Mar 25 (APP):Pakistan Peoples Party (PPP) Chairman Bilawal Bhutto Zardari on Saturday visited Minister for Commerce Syed Naveed Qamar and discussed with him matters related to the prevailing political and economic situation in the country.
“Chairman Bilawal came over for a discussion on the political and economic situation in Pakistan today,” the minister said on his Twitter handle.
